import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../App.css';
import LoginBtn from "./LoginBtn";
import 'bootstrap/dist/css/bootstrap.min.css';

export default function LoginBox({googleSignIn, emailSignIn, email, password, showLogin}){
    return(
        <>
            <section className="login-box">
                <h1>Login to your profile</h1>
                <form className="form g-4">
                    <input className="form-control" type="email" id="email"/>
                    <input className="form-control" type="password" id="pass"/>
                    <LoginBtn type="Email" emailSignIn={emailSignIn} email={email} password={password}/>
                </form>
                <LoginBtn type="Google" googleSignIn={googleSignIn} showLogin={showLogin}/>
            </section>
        </>
    )
}
